def strStr(haystack: str, needle: str) -> int:
    l_hay = len(haystack)
    l_needle = len(needle)

    if haystack is None or needle is None or l_needle == 0:
        return 0

    if l_needle > l_hay:
        return -1

    for haystack_index in range(l_hay):
        is_has_needle_at_cur_index = True
        for needle_index in range(l_needle):
            # If we are at the end, there is no way needle can fit into remaining haystack.
            if haystack_index + needle_index > len(haystack) - 1:
                return -1
            c1 = haystack[haystack_index + needle_index]  # Add offset
            c2 = needle[needle_index]
            if c1 != c2:
                is_has_needle_at_cur_index = False
                haystack_index = haystack_index + needle_index
                break
        if is_has_needle_at_cur_index:
            return haystack_index

    return -1


if __name__ == "__main__":
    haystack = "hello"
    needle = "ll"
    res = strStr(haystack, needle)
    assert res == 2

    haystack = "aaaaa"
    needle = "bba"
    res = strStr(haystack, needle)
    assert res == -1

    haystack = ""
    needle = ""
    res = strStr(haystack, needle)
    assert res == 0

    haystack = "a"
    needle = "a"
    res = strStr(haystack, needle)
    assert res == 0

    haystack = "ab"
    needle = "a"
    res = strStr(haystack, needle)
    assert res == 0

    haystack = "pppab"
    needle = "ab"
    res = strStr(haystack, needle)
    assert res == 3

    haystack = "pppababb"
    needle = "abb"
    res = strStr(haystack, needle)
    assert res == 5

    haystack = "This is a simple string"
    needle = "simple"
    res = strStr(haystack, needle)
    assert res == 10

    haystack = ""
    needle = "a"
    res = strStr(haystack, needle)
    assert res == -1

    haystack = "mississippi"
    needle = "issipi"
    res = strStr(haystack, needle)
    assert res == -1

